import React from 'react';
import { Tabs, Tab } from 'react-bootstrap';
import { Languages, WebTech, OtherTech } from './SkillsList';
import styled from 'styled-components';

const SkillList = styled.div`
    padding-top: 7%;
    width: 100%;
    height: 100%;
`;

const Title = styled.h2`
    display: flex;
    justify-content: center;
    text-decoration: underline;
    padding-bottom: 5%;
    font-size: 44px;
`;

const Center = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    padding-bottom: 20px;  
`;

export default function Skills() {
    return (
        <SkillList id="skills">
            <Title className="section-title">Skills</Title>
            <Center>
                <Tabs defaultActiveKey="languages" id="skills-tabs">
                    <Tab eventKey="languages" title="Programming Languages" > 
                        <ul className="skills-list">
                            {Languages.map((item, index) => {
                                return (
                                    <li key={index}>
                                        <span>{item.name}</span>
                                        <br /> 
                                        <i className={item.cName}></i>
                                    </li>
                                )
                            })}
                        </ul>
                    </Tab>
                    <Tab eventKey="web-tech" title="Web Technology"> 

                    </Tab>
                    <Tab eventKey="other-tech" title="Other Technology"> 

                    </Tab>
                </Tabs>                
            </Center>

        </SkillList>
    )
}
